import { useEffect, useState } from "react";
import { Link,Switch, Route } from "react-router-dom";
import '../node_modules/bootstrap/dist/css/bootstrap.css';
import './common.css'
import { useNavigate } from 'react-router-dom';
import { useParams } from "react-router-dom";
import { getEmpList } from "./services/user";

import { toast } from "react-toastify";



function EmpList()
{
  const [emps, setEmps] = useState([]);
  const navigate = useNavigate();
  const { branchId } = useParams();
    const AddEmp=()=>
    {
       navigate('/addemp')
    }
    const EditEmp=()=>
    {
        navigate('./EditEmp')
    }

    useEffect(() => {
      // get the list of products from server
      loadBranch(branchId);
    }, []);

    const loadBranch = async (branchId) => {
      debugger;
      const response = await getEmpList(branchId);
      debugger;
      if (response !==null) {
        setEmps(response);

      } else {
        toast.error("Error while calling get /product api");
      }
    };
    return(
      <>
        <div className="length">

<div>
            <table className="table table-bordered">
            <thead>
              <tr className="colr">
                <td>Emp Id</td>
                <td>Emp firstName</td>
                <td>Emp lastName</td>
                <td>Emp email</td>
                <td>Emp Password</td>
                <td>Emp role</td>
                <td>Emp mobile</td>
                <td>Emp gender</td>
                <td>Emp branchId</td>
              </tr>
            </thead>

            <tbody>
              {emps.map((emp) => {
                return (
                  <tr key={emp.empId}>
                    <td>{emp.empFirstName}</td>
                    <td>{emp.empLastName}</td>
                    <td>{emp.email}</td>
                    <td>{emp.password}</td>
                    <td>{emp.role}</td>
                    <td>{emp.mobile}</td>
                    <td>{emp.gender}</td>
                    <td>{emp.branchId}</td>
                    <td>
                     <button onClick={EditEmp} className="btn btn-primary"> 
                        Edit
                      </button>
                    </td>
                    <td>
                      <button class="btn btn-danger">Delete</button>
                    </td>

                  </tr>
                );
              })}
              ;
            </tbody>
          </table>
          <center>
            <button onClick={AddEmp} className="btn btn-primary">
              Add Branch
            </button>
          </center>
        </div>
      </div>
    </>
  );
}
export default EmpList
